import React, { useState } from 'react';
import { images } from '../../constants';
import './SpecialMenu.css';

const SpecialMenu = () => {
  const [himachaliModal, setHimachaliModal] = useState(false);
  const [rajasthaniModal, setRajasthaniModal] = useState(false);
  const [punjabiModal, setPunjabiModal] = useState(false);

  const toggleHimachaliModal = () => {
    setHimachaliModal(!himachaliModal);
  };

  const toggleRajasthaniModal = () => {
    setRajasthaniModal(!rajasthaniModal);
  };

  const togglePunjabiModal = () => {
    setPunjabiModal(!punjabiModal);
  };

  return (
    <div className="app__specialMenu" id="Menu" style={{ scrollMargin: "50px" }}>
      <div className='card-container' id='menu'>
        {/* Himachali Thali */}
        <img src={images.himachali_thali} alt="about_himachali_thali" className='himachali_thali_image' />
        <h1 className='card-title'>Himachali Thali</h1>
        <p className='card-description'>
          This is the description of the Himachali Thali, detailing what is served inside the thali and what you would like to eat.
        </p>
        <button type="button" className="custom__button" onClick={toggleHimachaliModal}>
          Order Himachali Thali
        </button>
        {himachaliModal && (
          <div className="modal">
            <div className="overlay"></div>
            <div className="modal-content">
              <h2>Order</h2>
              <p>You have ordered a Himachali Thali.</p>
              <button className='close-modal' onClick={toggleHimachaliModal}>
                CLOSE
              </button>
            </div>
          </div>
        )}

        {/* Rajasthani Thali */}
        <img src={images.rajasthani_thali} alt="about_rajasthani_thali" className='rajasthani_thali_image' />
        <h1 className='card-title'>Rajasthani Thali</h1>
        <p className='card-description'>
          This is the description of the Rajasthani Thali, detailing what is served inside the thali and what you would like to eat.
        </p>
        <button type="button" className="custom__button" onClick={toggleRajasthaniModal}>
          Order Rajasthani Thali
        </button>
        {rajasthaniModal && (
          <div className="modal">
            <div className="overlay"></div>
            <div className="modal-content">
              <h2>Order</h2>
              <p>You have ordered a Rajasthani Thali.</p>
              <button className='close-modal' onClick={toggleRajasthaniModal}>
                CLOSE
              </button>
            </div>
          </div>
        )}

        {/* Punjabi Thali */}
        <img src={images.punjabi_thali} alt="about_punjabi_thali" className='punjabi_thali_image' />
        <h1 className='card-title'>Punjabi Thali</h1>
        <p className='card-description'>
          This is the description of the Punjabi Thali, detailing what is served inside the thali and what you would like to eat.
        </p>
        <button type="button" className="custom__button" onClick={togglePunjabiModal}>
          Order Punjabi Thali
        </button>
        {punjabiModal && (
          <div className="modal">
            <div className="overlay"></div>
            <div className="modal-content">
              <h2>Order</h2>
              <p>You have ordered a Punjabi Thali.</p>
              <button className='close-modal' onClick={togglePunjabiModal}>
                CLOSE
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default SpecialMenu;
